      instructions:
        "<ol><li>Preheat oven to 400 degrees.</li><li>Wash beets and cut off greens only...not the stems (save greens for another use...delicious sauted in e.v.o.o. and stirred into pasta)</li><li>Tear off 3 pieces of tin foil twice as large as size of 1 bunch of beets.</li><li>Place the trimmed beets in the center of one piece of foil.</li><li>Drizzle with 2 turns of the olive oil.</li><li>Sprinkle with a pinch of grey salt.</li><li>Wrap the beets tightly in the foil to ensure no steam escapes.</li><li>Place on a rimmed baking sheet and add to preheated oven</li><li>After beets have been roasting for approx. 40 minutes, remove from oven.</li><li>Add fig slices and orange sections directly to the same rimmed baking sheet...push the beet packets to one side of pan.</li><li>Drizzle figs and oranges with a couple passes of extra virgin olive oil and sprinkle with sea salt (about a tsp of salt).</li><li>Add back to oven and continue roasting for an additional 20 minutes or until figs and oranges have begun to caramelize and beets can be easily pierced with a knife. (be very careful when opening beet packets to allow the steam to escape).</li><li>Let cool and peel the beets. cut in half and then into wedges. set aside.</li><li>Meanwhile add spinach to medium bowl.</li><li>Add a couple of tablespoons of honey mustard vinaigrette and toss. go light with the dressing, you don't want to drown the leaves...start with 1 tbsp, toss and add a little at a time of the second tbsp.you may not need all of the second tbsp.</li><li>Add feta and salt & pepper to taste.</li><li>Mound spinach on a serving platter.</li><li>Scatter the beets, figs and orange wedges on top on the spinach.</li><li>Drizzle the fig/balsamic reduction (or balsamic vinegar) over the top of the salad.</li><li>Drizzle a bit more honey mustard vinaigrette if desired.</li><li>Adjust seasonings to taste and serve immediately.</li><li>Honey mustard vinaigrette</li><li>Cup champagne vinegar</li><li>Pinch grey salt</li><li>Pinch black pepper</li><li>Tbsp honey mustard</li><li>Cup extra virgin olive oil</li><li>Make viniagrette... add vinegar, salt pepper and mustard to small bowl and whisk to incorporate. pour in e.v.o.o in a stream whisking constantly. taste and adjust seasonings if necessary. transfer to small mason jar with lid and set aside.</li><li>White on rice couple's fresh fig & balsamic reduction</li><li>About 1 cup ripe fig pulp</li><li>Cup balsamic vinegar</li><li>Tsp pure vanilla (i like tahitian)</li><li>Scoop out fig pulp</li><li>In saucepan, add vinegar, fig pulp and simmer on low heat until mixture reduces down to about half. Stir occasionally (every 5-8 minutes). this will take 30-45 minutes.</li><li>Allow fig/balsamic reduction to cool. place mixture in blender or food processor. blend thoroughly until mixture combines and becomes smooth. this step will also help release the seed from any pulp that has not cooked down. in separate bowl, strain out fig seeds. depending on your strainer, you might need to strain it at least two times to remove most of the seeds.</li><li>Add 1 teaspoon vanilla to reduction, combine well</li><li>The reduction is very concentrated. use about 1 tsp at a time (or to taste) to your favorite marinades, sauces, dressings and drizzles.</li></ol>",
